script: |
  super -f text -I q9415.spq | sort > q9415.out

inputs:
  - name: q9415.spq
    data: |
      SELECT ALL + 4 * + col1 + col1 AS col0, - col2 / - - col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 BETWEEN - - CAST ( 43 AS INTEGER ) + - CAST ( 66 AS INTEGER ) AND - ( - + col0 ) + col0;
  - name: tab1

outputs:
  - name: q9415.out
    data: |
